import './App.css';
import axios from 'axios';
import React, { useEffect, useState } from 'react';

function App() {
  const [cursos, setCursos] = useState([]);
  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:8080/curso');
        setCursos(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    }
    fetchData();
  },[]);

  return (
    <div className="App">
      <h2>Cursos de facultad Estudios Tecnologicos</h2>
      <h6>LISTADO DE CURSOS DISPONIBLES</h6>

      {cursos.map((elemento, id) => (
          <li>{elemento.nombreCurso}</li>
        ))}


      {JSON.stringify(cursos,null,2)}
    </div>
  );
}
export default App;
